node.text:
Wow! We have gotten so much LOVE for the “I Am Nothing” music video, and I just wanted to take a moment to thank everyone involved in making it come to life! 

First and foremost, a huge thank you to @lindastrawberry for directing and editing such a beautiful video, and her crew for working so hard to make the most beautiful backdrops, including the 8 foot tall mirrored crucifixes that stood behind the band’s performance scenes! 

My amazingly talented band @sammidoll @mrpharmacist72 @daveparley and @brynnroute for breathing life into the song, and putting up with my crazy music video ideas! 

Our two amazing makeup artists @iamleah and @juscallmetara for making our wildest glitter dreams come true! 

@dilarafindikoglu for making the two beautiful dresses I wore. 

@atomicerin_ for making all of our nails look as pretty as possible! 

@electricponystudios for the most accommodating space to film, and making us feel so damn welcome! 

And to all of you who continue to love and support me on this musical journey!  I really hope you loved this music video, and can’t wait to start touring soon and play all these songs Live for you! ❤️ #lovemademedoit
